import React,{useState,useEffect,Fragment} from 'react';
import Movie from '../Movie/Movie';
import './Movies.css';
import '../Movie/Movie.css';
const Movies = ({videos}) =>{
  const [ showIcon, setShowIcon ] = useState(false);
  return(
    <Fragment>
      <ul className = 'movies'>
        {
          videos.map( video => <li className = 'classLi'><a href = '' onMouseEnter = {(event) => setShowIcon(true)}><Movie video = {video.video_url} title = {video.name} description = {video.description} showIcon = {showIcon}/></a></li>)
        }
      </ul>
    </Fragment>
  )
}
export default Movies;
